`,a(t.p,{children:"see that clam that the host camera is cropped in?"}),`
`,a(t.p,{children:"making that thing turned out to be a trip to hell and back"}),`
`,a(t.p,{children:"all because they wanted a frame of a clam"}),`
`,a(t.p,{children:"to put a camera inside for a game show"}),`
`,a(t.p,{children:a(t.img,{src:"https://media.discordapp.net/attachments/1029264206081572905/1103539203733733396/image.png",alt:""})}),`
`,a(t.p,{children:"first i had to get a very legal copy of adobe illustrator EXCLUSIVELY to make this clam"}),`
`,a(t.p,{children:"then open up the original .ai file that included the clam image used on the map screen"}),`
`,a(t.p,{children:"it's like 120 px"}),`
`,a(t.p,{children:"my source material was a 120 px"}),`
`,a(t.p,{children:"you might think i could just raster export it with higher def"}),`
`,a(t.p,{children:"but that illustrator loses all semblance of capability as soon as you put a pattern in that shadow."}),`
`,a(t.p,{children:"so i have to scale it up manually"}),`
`,a(t.p,{children:"scaling it up breaks everything because u remember the pattern in the shadow?"}),`
`,a(t.p,{children:"yeah illustrator doesn't even scale that up"}),`
`,a(t.p,{children:"i never used illustrator before"}),`
`,a(t.p,{children:"so i had to dig thru every single context menue"}),`
`,a(t.p,{children:"(there are a lot of context menus)"}),`
`,a(t.p,{children:"to try to find out how to increase the scale of the fill pattern"}),`
`,a(t.p,{children:"which i somehow FOUND"}),`
`,a(t.p,{children:"and it wasn't just a number"}),`
`,a(t.p,{children:"it was it's own canvas i had to change the size of manually"}),`
`,a(t.p,{children:"to scale the pattern, you also had to manually drag out those rectangles"}),`
`,a(t.p,{children:"so i had to manually eye-pick play around with it to try to get the same sorta scale"}),`
`,a(t.p,{children:"THEN I REALIZE THE DOTS ARE THEIR OWN EFFECT"}),`
`,a(t.p,{children:"so i had to scale up the radius of those dots too"}),`
`,a(t.p,{children:"dug thru a bunch more to find that"}),`
`,a(t.p,{children:"then i tried to export it and adobe decides to export the svgs as images???"}),`
`,a(t.p,{children:"so i can't mask individual things anymore"}),`
`,a(t.p,{children:"so i fill it in with green cuz why not"}),`
`,a(t.p,{children:"then i realize that there's a dot effect on the green fill"}),`
`,a(t.p,{children:"so i have to remove that ; reexport"}),`
`,a(t.p,{children:"all of a sudden the layout of everything just goes to shit"}),`
`,a(t.p,{children:"like all i did was remove an effect and the whole layout shifts ??"}),`
`,a(t.p,{children:"when i export"}),`
`,a(t.p,{children:"so i literally open up the svg in VSCODE"}),`
`,a(t.p,{children:"TO COPY PASTE THE PROPERTIES THAT DIDNT MAKE IT OVER"}),`
`,a(t.p,{children:"INTO THE RIGHT LINES"}),`
`,a(t.p,{children:a(t.img,{src:"https://cdn.discordapp.com/attachments/1029264206081572905/1103540288208764979/image.png",alt:""})}),`
`,a(t.p,{children:"THIS"}),`
`,a(t.p,{children:"LIKE WHAT THE FUCK"}),`
`,a(t.p,{children:'anyway while im doing it i realize "wait a minute"'}),`
`,a(t.p,{children:'"this is.. an svg now"'}),`
`,a(t.p,{children:"so it turns out the reason the whole layout shifted is because now it's an svg and not a png"}),`
`,a(t.p,{children:"and adding a pattern effect is the reason illustrator cant export as an svg"}),`
`,a(t.p,{children:"SO THE 2nd IMAGE ACTUALLY BECOMES AN SVG WHEN I REMOVE THE EFFECT"}),`
`,a(t.p,{children:"AND SO THE LAYOUT SHIFTS CUZ ILLUSTRATOR CANT EVEN BE EXPORT THE SAME THING ACROSS FILE TYPES"}),`
`,a(t.p,{children:"anyway so then i realize"}),`
`,a(t.p,{children:"since it's actually an svg path now i can get rid of the green screen and actually mask"}),`
`,a(t.p,{children:"so then i take the svg"}),`
`,a(t.p,{children:"and throw it into lunacy"}),`
`,a(t.p,{children:"and then spent 30 minutes playing with masks and stuff to try to get it to hide the inside shadow"}),`
`,a(t.p,{children:a(t.img,{src:"https://media.discordapp.net/attachments/1029264206081572905/1103540844126023742/image.png",alt:""})}),`
`,a(t.p,{children:"turns out that's a lot harder than i thought and the end result is insane"}),`
