`,a(t.p,{children:"then i added a new rectangle around the whole thing"}),`
`,a(t.p,{children:"then i use the 'subtract' union on both of those images"}),`
`,a(t.p,{children:"then i use that as a mask for the shadow part"}),`
`,a(t.p,{children:"then i take the original clam and put it on top"}),`
`,a(t.p,{children:"ok anyway i export the svg from lunacy"}),`
